import React from 'react';
import './Signup.css';

const Signup = (props) => {
  return (
    <div className="authcontainersignup">
      <span>Create an account!</span>
      <div className="authcontainersignup__section">
        <span>Email</span>
        <input />
        <span>Username</span>
        <input />
        <span>Password</span>
        <input />
        <button>Sign-up</button>
        <p>Already have an account?</p>
      </div>
    </div>
  );
};

export default Signup;
